import HolidayCalendarItem from '../HolidayCalendarItem/HolidayCalendarItem';
import s from './HolidayCalendarList.module.css';

let array = [1, 2, 3, 4, 5];

const HolidayCalendarList = () => {
	return (
		<div className={s.list}>
			{array.map((item) => (
				<HolidayCalendarItem />
			))}
		</div>
	);
};

export default HolidayCalendarList;
